u shelter from the storm\"\nWell, I|m livin| in a foreign country but I|m bound to cross the line\nBeauty walks a razor|s edge, someday I|ll make it mine\nIf I could only turn back the clock to when God and her were born\n\"Come in,\" she said, \"I|ll give you shelter from the storm\"','[-0.22552446, 1.8032471, -0.5400681, 0.74654305, -0.019429188, 0.8905376, 0.28819326, 1.4821268, 0.9814715, 0.19380902, -0.9361717, -0.4794941, 1.3441293, -0.024518358, -1.0197337, -0.039237555, 0.11494325, 1.1060911, -0.34651214, 0.44796845, 0.42174903, 0.53373075, 0.43700513, -0.68159926, -0.56392443, 1.6168588, -1.0115179, 0.012925659, 2.4556253, 0.03253118, -1.2607698, 0.027124856, 1.4336882, -0.4445158, -0.18434729, 0.6640066, -0.73079395, -0.6911538, -0.6376063, -0.54734796, 0.1260629, 2.3'),(320,'Simple Twist of Fate','Bob Dylan','They sat together in the park\nAs the evening sky grew dark.\nShe looked at him and he felt a spark\nTingle to his bones.\n|Twas then he felt alone\nAnd wished that he|d gone straight\nAnd watched out for a simple twist of fate.They walked alone by the old canal.\nA little confused, I remember well,\nAnd stopped into a strange hotel with a neon burning bright.\nHe felt the heat of the night hit him like a freight train\nMoving with a simple twist of fate.A saxophone someplace far off played\nAs she was walking on by the arcade\nAs the light bust through a beat up shade\nWhere he was waking up.\nShe dropped a coin into the cup of a blind man at the gate\nAnd forgot about a simple twist of fate.He woke up; the room was bare.\nHe didn|t see her anywhere.\nHe told himself he didn|t care; pushed the window open wide;\nFelt an emptiness inside to which he just could not relate\nBrought on by a simple twist of fate.He hears the ticking of the clocks\nAnd walks along with a parrot that talks.\nHunts her down by the waterfront docks\nWhere the sailors all come in.\nMaybe she|ll pick him out again. How long must he wait\nOne more time for a simple twist of fat