f you\nThere|s some kind of madness in your eyes\n\nYou know a place buried deep in my heart\nNobody else can see\nSomething in you has taken some kind of hold on me\n\nI don|t know why I keep coming back to you, baby\nI don|t know why I keep coming back to you\nTo you baby\n\nYou say we shouldn|t be lovers\nAnd I say we can|t just be friends\nAnd all this talking just makes me want you more\nYou|ve got a way of confusing a heart\nThat nobody else could do\nWhy should I try, I don|t want to get over you\n\nI|m so in love, so in love with the games that you play\nSo in love, and nothing can keep me away\n\nYou|ve got a way of confusing a heart\nThat nobody else could do\nWhy should I try, I don|t want to get over you\n\nI don|t know why I keep coming back to you\nJust tell me why I keep coming back to you\n\n','[-0.42702547, 0.2079126, -0.41100368, -0.8365465, -1.1936857, -0.39658985, -1.3608785, 0.3821345, -1.6484134, 1.1470289, -1.1023115, 0.71324706, 0.49112302, -0.33901894, -0.18911889, -0.1725954, -0.6111252, 0.83475, 1.4654241, -0.08050808, -0.41483715, -0.12223991, 0.94127077, -0.20835054, 0.7970084, 0.44224945, -0.15692565, -0.6540203, 1.7134818, 1.0206921, 0.643434, -0.011396776, 1.235639, 0.4785689, 0.19379239, 0.46433592, 0.35177293, -1.0780096, -0.8621279, -0.24501842, -0.04548461, 0.906938'),(1527,'Last Thing I Wanted','Richard Marx','',''),(1528,'Like the World Is Ending','Richard Marx','',''),(1529,'Lonely Heart','Richard Marx','Heart beat pounding so hard it keeps me wide awake at night\nI wait alone in the dark for you to make the moment right\nIf I could only show you all that might be lost\nThen you would never wonder what the secret was\nAnd this is what I|d tell you\n\nThe lonely heart you see tonight\nWill not give up without a fight\nAnd I|m never gonna let it fade away\nNever gonna let it fade away\n\nOh, you can look in my eyes and see that you|re the only one\nI would break down and cry if you became the lonely one\nI|d rather play the fool 