 thing left to do\n\n','[-1.8707691, 0.4619106, 2.0403175, -1.3125775, 0.74226785, 0.22607388, -0.18028897, 0.37128156, -1.0968663, -1.1475356, 0.94548243, 0.18885206, 2.2513654, 0.7517539, 0.055293582, -1.208022, 1.2701133, 0.47607237, -0.5067649, -0.509036, -0.07820552, 1.8338797, 1.2030753, -0.29335353, 0.28525862, -0.051869955, -0.15391305, 1.2857542, 1.0741613, -0.9180559, -0.034903437, -0.8984186, 0.33025068, -1.0520105, -1.5256838, 0.1541817, 0.22601894, -2.3579435, -0.9688147, -1.0208586, 0.8231243, 0.93193674,'),(1536,'Ready To Fly','Richard Marx','I|ve been trying to open the door\nTo the secret of my destiny\nAnd every new road I think is the one\nSeems to lead right back to me\n\nI|ve looked for a way to be wiser\nA way to be strong\nNow I see the answer was hiding\nIn me all along\n\nAnd I|m ready to fly\nOver the sun\nLike a rocket to heaven\nAnd I|m ready to soar\nRight through the sky\nNever dreamed I|d find something to lift me so high\nI|ve always had wings\nBut I wasn|t ready to fly\n\nRestless, hopeless, and misunderstood\nLike so many others I know\nSo busy tryin| to keep holdin| on\nWhen I should|ve been letting go\n\nI was given the gift to find it\nThe spirit inside me\nBut I never really imagined\nAll I could be\n\nAnd I|m ready to fly\nOver the sun\nLike a rocket to heaven\nAnd I|m ready to soar\nRight through the sky\nNever dreamed I|d find something to lift me so high\nI|ve always had wings\nBut I wasn|t ready to fly\n\nThe answer to all of my wonder\nWas right in my hands\nNow it|s time for me to discover\nAll that I am\n\nAnd I|m ready to fly\nOver the sun\nLike a rocket to heaven\nAnd I|m ready to soar\nRight through the sky\nNever dreamed I|d find something to lift me so high\nI|ve always had wings\nBut I wasn|t ready to fly\n\nI|ve always had wings\nNow I|m finally ready to fly\n\n','[1.7561811, 0.16614419, -0.2726953, 0.022254014, 0.5605868, -0.45194444, 0.5804315, 1.4820069, 2.068962, 0.43081585, -0.7441704, 1.5000738, -0.97302914,