re must be more to living\nThan nine to five\n\nWhy should we wait for some better time?\nThere may not even be a tomorrow\nAin|t no sense in losing your mind\nI|m gonna make it worth the ride\n\nDon|t you know\nI won|t give up until I|m satisfied?\nDon|t you know\nWhy should I stop until I|m satisfied?\n\nIgnore the hesitation\nThat ties your hands\nUse your imagination\nAnd take a chance\n\nWon|t let my moment of truth pass me by\nI|ve gotta make my move, now or never\nAnd if they turn me loose on this town\nThey|re gonna have to hold me down\n\nDon|t you know\nI won|t give up until I|m satisfied?\nDon|t you know\nWhy should I stop until I|m satisfied?\nYeah\n\nDon|t you know\nAin|t gonna stop up until we|re satisfied?\nDon|t you know\nWe shouldn|t stop until we|re satisfied?\nYeh, yeah\n\nDon|t you know\nAin|t gonna stop until I|m satisfied? Yeah\nDon|t you know\nWe won|t give up until we|re satisfied?\nOh, oh, oh\n\nWhy should I stop before I|m satisfied? Ow\n\n','[0.02229097, 0.88906926, -0.4775863, -0.64979595, 0.286904, -0.7962975, -0.66230786, 0.7688527, -1.3021804, 1.151087, -1.0580049, -0.60009503, 0.82920724, 1.1702113, 0.05932996, 1.4076436, 0.374672, -0.73088753, 1.7492566, -1.1265373, 0.00346861, 0.40776923, 1.1442393, 1.4836305, 1.1744434, -0.86687875, -0.116546296, -1.0717796, 1.0306352, -0.40544084, 0.3981603, -0.5118843, -1.1819763, -1.0291085, -0.6473407, -0.2507417, -0.5250423, -0.30874914, 0.7076565, -0.1545511, 0.60091347, 0.23429313, -0'),(1539,'Should\'ve Known Better','Richard Marx','',''),(1540,'Silent Scream','Richard Marx','Twenty-four and he belives for sure he|s got it made\nFame is here for good and looks will never fade\nHe doesn|t know - the game is never over till the cards have all been played\nEighty-three and still he feels his best is yet to come\nHe belives that youth is wasted on the young\nHe|s alone - the only dream he ever had was being with somone\n\nLove you when you|re standing tall, but nobody knows you when you|re falling\nAll you have to do is call, but nobody ever hears the silent scream\n\nChristmas came and went again but still nobody came\nStarring at a wedding photo with a frame\nShe|s alone - we should hope the lost of memory helps to ease the pain\n\nLove you when you|re standing tall, but nobody knows you when you|re falling\nAll you have to do is call, but nobody ever hears the silent scream\n\nMemories-moments you recall\nWe should be remembered for the greatest of them all\nYou can|t begin to live someone elses| life-or your own will pass you by\nOh - who|s to know\nMaybe we can learn a thing or two from every one...\nLove you when you|re...\n\n','[0.78235924, 2.3848128, -1.3161638, 0.10653988, -1.2507234, 0.8534773, 0.23467311, 0.97396165, 1.070637, 0.61856383, -0.29542616, -0.16844472, -0.002331933, 1.7673423, -1.1171174, 1.698621, 1.1321907, -1.46699, 0.50750047, -0.6417474, -1.1111823, 0.42622095, -0.07796485, 0.07710769, -1.2299447, -0.426431, -1.0295594, -1.099891, -0.68776155, 0.06648342, -0.8592918, -0.08368847, 0.70400035, -0.25768933, 1.5884421, -0.49666968, 0.37254065, -0.4032873, 1.3738286, 0.10628753, 0.19089797, 2.584711, -1'),(1541,'Soul Motion','Richard Marx','I|ve got the fever, \nPoison in my veins\nMy mind ain|t working right\nI know the answer, \nThe way to ease this pain\nOnly got myself to fight\nI can see clearly but choose to be blind\nA slave to desire\nHolding me, scolding me, changing your mind\nYou|re like playing with fire\n\nI need you\nI want to stay on this soul motion ride\nThere is no danger when you|re here by my side\n\nGiven some distance,\nJust a little time\nRight and wrong seems clear\nBut my sense of reason is nothing but unkind\nEvery time that you|re near\nOver and over I say to myself\nOoh, she|s only playing\nTen thousand reasons to find someone else\nStill I hear myself saying\n\nI need you\nI want to stay on this soul motion ride\nThere is no danger when you|re here by my side\n\nI|m out here on the edge\nAnd I know what|