I want to know what it feels like to be that sure\nOf anything ....','[-0.038297523, -0.9453628, -1.167257, 0.4434604, 0.5552882, -0.057355504, 2.049221, -0.026806038, 1.1945245, 1.1062999, -1.9281971, -0.72612566, 1.1476915, 2.5269825, -1.3513734, -0.3880758, -0.9145835, -0.019488988, -0.6342013, 0.047124606, 0.07339659, -0.5207115, 0.2374415, -0.29467237, 1.1749845, 0.07273151, 1.1281153, 0.7964467, -1.1117564, 0.307479, -0.15395989, -1.5951027, -0.4294163, 0.7902495, 0.38872483, -1.1982286, 0.15384498, -0.7733757, -0.9589393, 1.569681, 0.10314579, 0.99983776, -'),(1655,'Sweet Surrender','Sarah Mclachlan','It doesn|t mean much\nIt doesn|t mean anything at all\nThe life I|ve left behind me is a cold roomI|ve crossed the last line\nFrom where I can|t return\nWhere every step I took in faith betrayed me\nAnd led me from my homeAnd sweet surrender\nIs all that I have to giveTake me in, no question|s asked\nYou strip away the ugliness that surrounds me\n(Who are you?)\nAre you an angel?Am I already that gone?\nI only hope that I won|t disappoint you\nWhen I|m down here on my knees\n(Who are you?)And sweet surrender\nIs all that I have to give\n(Who are you?)And sweet surrender\nIs all that I have to giveDon|t understand\nThe touch of your hand\nI would be the one to fall\nI miss the little things\nI miss everything about youDoesn|t mean much\nIt doesn|t mean anything at all\nThe life I left behind me is a cold room\n(Who are you?)And sweet surrender\nIs all that I have to give\n(Who are you?)And sweet surrender\nIs all that I have to give','[-1.0438372, 0.6396699, -0.1937821, 2.0425346, 0.9184143, 0.6088061, 0.059636366, -0.15820445, 0.12004034, -0.45819914, -0.43351096, 0.74121994, 0.9157946, 1.0195073, -1.8460475, -0.26466712, 0.23791721, 0.0658281, -0.77828884, -0.97157884, 0.91990423, 0.2500907, -0.39714295, 0.21969095, -0.75949633, 1.9276843, -0.14115104, -1.4500581, -0.79582614, 0.30330533, 0.016821947, -0.7992269, -1.6178379, 1.0212256, 1.3104392, 0.6270813, 0.46280923, 0.3963894, -1.5549333, 0.52359354, -0.23073874, 1.63039'),(1656,'The Long Goodbye','Sarah Mclachlan','Catch a star as it falls and hold it in your hand\nFeel the heat still it burns searing embers of your glorious sun\nOh this is painful this endless aching need\nThe very thing I long for is what brings me to my kneesYou walked in to my world won me over caught me so off guard\nBut I gave in to the wonder to the poetry of our souls set fire\nAnd oh it was beautiful our tender hearts entwined\nAnd I thought we could conquer any mountains we would climbAnd now I|m waiting on the light\nTo ease the fury of this one desire\nI|m trying to be patient I|m trying to stay high\nI|m trying to find the wisdom in this long goodbyeStop the world stop the noise I|ve heard enough my head is spinning |round\nGive me more than words to feed me truth I can believe in give me solid ground\nBut our days are measured in fraying threads of gold\nEvery day unraveling till there|s nothing left to holdNow I|m still waiting on the light\nTo ease the fury of this losing fight\nI|m trying to forgive you to hold my head up high\nI|m trying to find the wisdom in this long goodbyeI gave my love gave it all but in the end it didn|t change a thing\nYou can|t love a man out of his fate can|t tame a head and heart so out of sync\nBut oh I am grateful this will not bring me down\nThe tides are always gonna turn and come on back around','[-0.4391047, 0.77817816, -2.2720745, -1.0926758, 1.5029188, -0.3796251, -0.39706588, 0.20254588, 1.3993245, -0.37679595, -0.82729465, 0.77855605, 1.3068051, 0.1557305, -0.14633057, 0.88454044, -0.40615502, -0.62590355, 0.5595025, -0.7203717, 0.038075425, 0.65837216, 1.3635374, 0.5416179, 1.6600204, 0.87114406, 1.059393, -0.6181254, 0.92541146, 0.31900582, -0.61941624, -0.89783335, -0.385855, 0.25380462, 1.860276, -0.8267166, 1.0987581, -0.6703846, -1.2549851, -0.23103368, -0.4775346, -0.4931362,'),(1657,'The Sound That Love Makes','Sarah Mclachlan','Can you hear it? This is the sound that love makes\nThe fingerprint of a snowflake\nIt paints a picture of you\nCan you feel it? This is the flavor of sunshine\nThe way your body it moves mine\nI can taste you in the coolest raindrops\nOne hand in the other unlike any other hand I know\nI|m seeing the sun in all the darkest grey skies\nThis time I|m going in for the sweetest kill\nI|m gonna eat till I get my fill\nSo delicious are my lips on your skin\nOne hand in the other unlike any other hand I know\nI|m seeing the sun in all the darkest grey skies\nSweetness, this is the rhythm of thunder\nFrom up above or down under\nI love you','[-0.9703641, 0.37489378, -1.3450677, 0.031342007, -0.823345, 0.69160265, 0.68736887, 0.3523498, -1.2480649, 0.9568564, -0.4833629, -0.0957985, -0.09464271, 0.8382515, 0.24938704, 0.4046091, 0.009902192, 0.7373871, -0.17920919, 0.7287159, -0.5808654, -0.19453743, -0.418428, 0.56896114, 0.3232403, 0.48012912, 0.9306906, -0.909902, -0.3555129, 0.22800723, 0.06484193, -0.5184017, -0.46710557, 0.26135892, 0.64191854, -0.02950512, 0.8162016, -0.31334877, -0.4460074, -0.45644692, -0.7541607, 0.54386926'),(1658,'U Want Me 2','Sarah Mclachlan','You walk on by\nClueless and so high\nFollowing your aimless path away from us\nYou|re so far away\nAnd what can I say\nCause I can|t be the one you wanted me to beSo tell me how do you feel\nIt|s so confusing\nIf you let it all go, it|ll fall apart\nDo you want me to stay and say I still want you\nYou want me too, don|t you?So what are we saying\nOur eden|s a failure\nA made-up story to fit the picture-perfect world\nThe one with \"I do\"\nand \"I love you\"\nAnd we are made for each other\nIs forever over now?And tell me how do you feel\nIt|s so confusing\nIf you let it all go, it|ll fall apart\nDo you want me to stay and say I still want you\nYou want me too, don|t you?I hope there|s forgiveness\nIn the distance between us\nCan we make what lies ahead of us a better place to be?So tell me, how do you feel\nIt|s so confusing\nIf you let it all go, it|ll fall ---\nDo you want me to stay and say I still want you\nYou want me too, don|t you?','[-0.27871746, -0.9535449, -0.54235286, 1.3238788, -0.3814832, -0.89568543, 0.5320799, 0.18527636, -0.7805626, 0.63106483, 0.13789934, 1.8833754, 0.72936404, -0.18770333, -0.8185092, 0.23357838, -0.56339127, 0.4043064, -0.6311859, -0.98688155, 0.53636885, 0.19361025, 1.6928587, -0.5600983, 0.47491747, 0.19694449, 0.12480293, -0.47108027, 1.198191, 0.4902572, -0.0020645198, -0.82109225, -0.41185164, -0.0076702186, 0.17235266, -1.493478, 0.35707682, -0.98659724, -0.34980187, -0.122476205, 0.3409881'),(1659,'When She Loved Me','Sarah Mclachlan','When somebody loved me\neverything was beautiful.\nEvery hour we spent together\nlives within my heart.And when she was sad\nI was there to dry her tears.\nAnd when she was happy so was I.\nWhen she loved me.Through the summer and the fall\nwe had each other, that was all.\nJust she and I together\nlike it was meant to be.And when she was lonely\nI was there to comfort her.\nAnd I knew that she loved me.So the years went by.\nI stayed the same\nbut she began to drift away\nI was left alone.\nStill I waited for the day\nwhen she|d say \"I will always love you.\"Lonely and forgotten\nnever thought she|d look my way.\nAnd she smiled at me and held me\njust like she used to do.\nLike she loved me.When she loved me.\nWhen somebody loved me\neverything was beautiful.\nEvery hour we spent together\nlives within my heart.\nWhen she loved me...','[0.9865139, 0.8799195, 0.5353884, -0.12792543, -1.5889423, 1.1284049, 0.6298709, 0.31674147, 0.6563426, 0.8656173, 0.40756917, -0.6888182, 2.322675, -0.8740717, 0.22027017, -0.02834945, -0.3402183, 0.29592034, -1.2203004, -0.1482837, 0.95316225, -0.4540907, 0.91598576, 0.05461474, -1.352776, 2.0196316, -0.09635416, -0.8564827, -0.122616895, -1.1766801, -1.3923801, 0.974978, 2.1512246, -0.5775069, 0.31145892, 1.4949244, -0.39582917, -0.54484713, 0.1864398, -0.1861305